import './App.css';
import show from './view.svg';
import hide from './hide.svg';
export default function Login(){
    const [dt,setdt] = useState('')
    const [eye,seteye]=useState(hide);
    const [email,setemail]=useState("");
    const [password,setpassword]=useState("");
    const [type,settype]=useState("password");
    const typechange = ()=>{
      if(eye ==show)
      settype("text")
      else
      settype("password")
    }
    const emailchange=(event)=>{
      console.log(event)
      setemail(event.target.value);
     }
     const eyechange = ()=>{
       if(eye==show){
         
         typechange();
         seteye(hide);}
      else{
        typechange();
      seteye(show)
      }
     };
        const passchange = event =>{setpassword(event.target.value);}
        const checkuser = async()=>{
          const body = JSON.stringify({username:email,password:password})
const options ={
  method:"POST",
  header:{
    'Content-Type':"application/json"
  },
  body:body
}
const token ="" 
await fetch("http://127.0.0.1:80/jsoncreateuser",options).then(res=>{token=res.headers['jsontoken']})
console.log(token)
        }
    return (
      <div className="App">
        <div className="App-div">
         <label style={{fontWeight: "bold",fontSize:"2.5em",marginBottom:"1em"}} for="">Login</label>
          <input type="text" name="email" value={email} onChange={emailchange}/>
          <label for="" style={{fontWeight:"bold",fontSize:"1.5em"}}>Email</label>
          <input type={type} name="password" value={password} onChange={passchange}/>
          <label style={{fontWeight:"bold",fontSize:"1.5em"}}>Password</label>
          <img src={eye} style={{height:"30px",marginTop:"3em"}} onClick={eyechange}/>
          <button onClick={checkuser}>Login</button>
          <label style={{marginTop:"1em",fontWeight:"bold",fontSize:"1.5em"}}>Sign Up?</label>
          <a style={{fontWeight:"bold",fontSize:"1.5em",marginTop:"1em"}} href={""}>Sign Up</a>
        </div>
      </div>
    );
  }
